INSERT INTO `giganexus_home_card` VALUES (17,'data:image/svg+xml;base64,','Zebronics','Mid-Tower Gaming Cabinet',1599,'ZEBRONICS ZIUM','Make your gaming space ultra-cool by installing the ZEB-Zium a mid-tower gaming chassis that will take your gaming experience to the next level with its compact outlook. It is visually appealing with the acrylic and transparent side panel and a front panel multicolored LED strip giving the chassis a complete finish.','Ventilation for the chassis is provided by one 80mm fan on the rear.  These fans are fins focussed multicolor fans that add a vibrant touch to the chassis The top panel of the chassis features one USB 3.0 port,   2 USB port connections for HD audio, and other device connectivity. You can now put add-on cards into the chassis expansion slots on the back panel'),(19,'data:image/svg+xml;base64,','Graphics card','Nvidia Geforce RTX 2080',30000,'Nvidia','GIGABYTE NVIDIA GeForce RTx 2080 WINDFORCE OC 12GB GDDR6 Graphics Card (GV-N3060WF2OC-12GD) comes with NVIDIA Ampere Streaming, Multiprocessors, 2nd Generation RT Cores, 3rd Generation Tensor Cores, Powered by GeForce RTX 3060, Integrated with 12GB GDDR6 192-bit, memory interface, WINDFORCE 2X Cooling System with alternate spinning fans, Screen cooling, 200 mm compact card size.','Graphics Processing  GeForce RTX 2080 Core Clock  1792 MHz (Reference Card 1777 MHz) CUDA Cores  3584 Memory Clock  15000 MHz; Memory Size  12 GB Memory Type  GDDR6; Memory Bus  192 bit Memory Bandwidth (GB/sec)  360 GB/s Card Bus  PCI-E 4.0 x 16 Digital max resolution  7680x4320 Multi-view  4 PCB Form  ATX DirectX  12 Ultimate OpenGL  4.6 Recommended PSU  550W Power Connectors  8 pin*1 Output  DisplayPort 1.4a *2 HDMI 2.1 *2 Accessories  Quick guide');
INSERT INTO `giganexus_home_card` VALUES (23,'data:image/svg+xml;base64,','Gaming Monitor','Samsung Odyssey G5',44499,'SAMSUNG','Vivid scenes wrap around you. The all-encompassing 1000R display fills every part of your peripheral vision and draws you right into the character\'s shoes. Experience a level of gaming more heart-pounding than anything before','34 inch Smart LED monitor with Curved design (Resolution 3,440 x 1,440)Aspect Ratio: 21:09Refresh Rate: 165 Hz,Response Time: 1.0 ms'),(24,'data:image/svg+xml;base64,','Play Station5','Sony PS5 Husky White',66990,'SONY','Brace yourself for a whole new world of possibilities as the PS5 unleashes unparalleled power and innovation Get ready to elevate your gaming experience to new heights with the Sony PlayStation 5 Console Unleash the power of play immerse yourself in stunning visuals and explore a world of endless possibilities With the PS5 gaming will never be the same again ','Model Number-PlayStation 5 console Sales Package-Gaming Console, Wireless Controller, Manual, AC Power Cord, USB Cable, HDMI Cable Console Type-Console HDMI-1 USB-3 Motion Controller Included-No'),(25,'data:image/svg+xml;base64,','X box','Xbox Starter Bundle',39990,'X box','Go all-digital and enjoy disc-free, next-gen gaming with the smallest Xbox console ever madeXbox game Pass ultimate includes over 100 high-quality games, online multiplayer, and an EA play membership for one low monthly price (membership sold separately)Introducing the Xbox series S, the smallest, sleekest Xbox console ever. Experience the speed and performance of a next-gen all-digital console at an accessible price pointExperience next-gen speed and performance with the Xbox velocity architecture, powered by a custom SSD and integrated software','Product Dimensions  36 x 29.2 x 12.8 cm; 3.35 kg Release date  10 November 2020 ASIN B08J89D6BW Item model Microsoft, Microsoft Packer  Microsoft Importer  Redington India Item Weight   3 kg 350 g Item Dimensions LxWxH  36 x 29.2 x 12.8 Centimeters Net Quantity   1 count Included Components With Xbox Series S, an Xbox Series S console, controller, Ultra High Speed HDMI cable and power cord are included.'),(26,'data:image/svg+xml;base64,','Gaming Mouse','Razer DeathAdder White',1349,'Razer','High-Precision 6,400 DPI Optical Sensor: Offers on-the-fly sensitivity adjustment through dedicated DPI buttons (reprogrammable) for gaming and creative work Durable Mechanical Switches: Supports up to 10 million clicks, backed by a 2 year warranty','Ridged, Rubberized Scroll Wheel for Maximum Accuracy: Small, tactile bumps increases grip and allows for more controlled scrolling in high-stakes gaming situations 5 Programmable Buttons: Allows for button remapping and assignment of complex macro functions through Razer Synapse');
INSERT INTO `giganexus_home_card` VALUES (43,'data:image/svg+xml;base64,','PSP Remote play','Sony PSP Husky White',28777,'SONY','NPlaystation 5 Not Included Put Your PS5 in the Palm of Your Hand - PlayStation Portal Remote Player gives you access to the games on your PS5 over your home Wi-Fi letting you jump right into gaming without needing to play on a TV Play Your Game Collection - PlayStation Portal Remote Player can play compatible games you have installed on your PS5 console, including your favorite games for PS5 and PS4.Experience Breathtaking Immersion with DualSense Wireless Controller Features','Beautiful 8 LCD Screen - Take in every exquisite detail of your favorite games as they come alive on a brightly lit and gorgeous full HD screen.60fps Capable at 1080p Resolution - PlayStation Portal Remote Player can deliver silky smooth gameplay at up to 60fps with high image clarity on its 1080p resolution screen.PlayStation Portal Remote  Player can stream compatible games.');
INSERT INTO `giganexus_home_card` VALUES (47,'data:image/jpeg;base64,','PSS Wireless Gaming','PSS Wireless Gaming ',1899,'PSS','NPlaystation 5 Not Included Put Your PS5 in the Palm of Your Hand - PlayStation Portal Remote Player gives you access to the games on your PS5 over your home Wi-Fi letting you jump right into gaming without needing to play on a TV Play Your Game Collection - PlayStation Portal Remote Player can play compatible games you have installed on your PS5 console, including your favorite games for PS5 and PS4.Experience Breathtaking Immersion with DualSense Wireless Controller .','');
